import React from 'react'
import { Header } from './components/header/Header';
import { SectionImg } from './components/sectionimg/SectionImg';
// import data from './data/data.json'

const data = {
  img:"https://cms-images.mmst.eu/2rj3gcd43pmw/X1s76hIAACQAcE2X/7b1ca0f17647631b0b498811510433c5/Prismic_LP_Visual_Energielabels_1257x703_Teaser_1.jpg?q=80",
  title: "test",
  content: 'I hope you enjoy learning React!',
  imgPosition: true
}

function App() {
  return (
    <React.Fragment>
      <Header/>
      <SectionImg img={data.img} title={data.title} content={data.content} imgPosition={data.imgPosition} />
    </React.Fragment>
  );
}

export default App;
